using System;
using System.Collections.Generic;
using System.Linq;
using System.Transactions;

namespace AoC.Year2018.Day5
{
    public class Faster : BasePart
    {
        public Faster()
        {
        }

        protected void RunScenario(string title, string input)
        {
            RunScenario(title, () =>
            {
                var lines = input.Split(new[] { '\r', '\n' }, StringSplitOptions.RemoveEmptyEntries);
                var line = lines[0];

                Console.WriteLine(React(line));

                var result = new Dictionary<char, int>();
                for(var i=0; i< 26; i++)
                {
                    var lower = (char)((int)'a' + i);
                    var upper = (char)((int)'A' + i);
                    result.Add(lower, React(line, lower, upper));
                }

                var last = result.OrderBy(i => i.Value).First();

                Console.WriteLine(last);
            });
        }

        private static int React(string line, char? skip1 = null, char? skip2 = null)
        {
            var stack = new Stack<char>();
            foreach (var item in line)
            {
                if (skip1 == item || skip2 == item)
                    continue;
                if (stack.TryPeek(out var peek))
                {
                    var other = item >= 'a'
                        ? (char) ((int) item - (int) 'a' + (int) 'A')
                        : (char) ((int) item - (int) 'A' + (int) 'a');
                    //Console.WriteLine($"Checking {item}->{other} vs {peek}: {other == peek}");
                    if (other == peek)
                    {
                        stack.Pop();
                        //Console.WriteLine("popped, left " + new string(stack.Reverse().ToArray()));
                        continue;
                    }
                }
                stack.Push(item);
            }

            //Console.WriteLine(new string(stack.Reverse().ToArray()));

            return stack.Count;
        }

        public override void Run()
        {
            RunScenario("initial", @"dabAcCaCBAcCcaDA");
            //return;
            RunScenario("part1", @"");

        }
    }
}
